import { Component, Fragment } from "react";
import React from "react";
import { Link } from "react-router-dom";

class CardMeusAgendamentos extends React.Component {
  state = {
    contract: null
  };

  constructor(contract) {
    super();
    this.state.contract = contract;
  }

  render() {
    return (
      <div className="col-sm-3 ml-5 mr-5 mt-4 d-flex align-items-stretch">
        {console.log(this.props.contract)}
        <div className="card h-25">
          <div className="card">
            <div className="card-header">
              <h5>
                Dia:
                {this.state.contract === null
                  ? "Sem Datas"
                  : new Date(
                      this.state.contract.contract.datas[0].dtAgendamento
                    ).toLocaleDateString()}
              </h5>
            </div>
            <div className="card-body">
              <h6>
                <label>Prestador:</label>
              </h6>

              <h6 />

              <h6 />

              <h6 />

              <h6 />
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default CardMeusAgendamentos;
